//meta data operation
import Head from "next/head"
import Image from "next/image"
export default function data(){
    return(
        <html>
            <Head>
                <title>Welcome to Next.js</title>
            </Head>
            <Image 
                src="/next.png"
                width={500}
                height={500}
            />
        </html>
    )
}
